// src/components/AboutUs.jsx
import React from "react";
import "./AboutUs.css";

const AboutUs = () => {
	return (
		<section id="about-us" className="about-us-section">
			<h2>About Us</h2>
			<p>
				Welcome to Nature's Plate! We believe in bringing fresh, organic, and
				healthy food straight from nature to your table. Our mission is to serve
				delicious meals that nourish both the body and the soul.
			</p>
		</section>
	);
};

export default AboutUs;
